import React from 'react'

function TrainList(props){

  const listItems = props.trains.map((train, i) => {

    return (
            <li key={i}>
              <strong>{train.stationName}</strong> -
              <span>platform: {train.platform}</span>
            </li>
            )
  });


  return (
    <React.Fragment>
      <h5>Train Schedule</h5>
      <ul>
        {listItems}
      </ul>
    </React.Fragment>
    )
}




export default TrainList;
